To add 94 and 28, we start by adding the ones place digits, which are 4 and 8. This gives us 12. Since 12 is a two-digit number, we write down the 2 in the ones place and carry the 1 to the tens place. 

Next, we add the tens place digits, which are 9 and 2 (plus the 1 we carried over). This gives us 12 again. We write down the 2 in the tens place and carry the 1 to the hundreds place. 

Since there are no hundreds place digits to add, we simply write down the 1 in the hundreds place. 

Putting it all together, we get:

\begin{align*}
&\phantom{ }\\
&\quad\, 1\,\,\, 9\,\,\, 4\\
&+ \,\,\,\,\,\,2\,\,\,\,\,\, 8\\
\cline{1-3}
&\boxed{123}
\end{align*} 

Therefore, 94+28=123.

